      // ========================================
      // SESSION MANAGEMENT: Single device enforcement
      // ========================================
      
      // Generate unique session ID for this browser/device
      generateSessionId() {
        return Date.now() + '_' + Math.random().toString(36).substr(2, 9);
      },
      
      // Start session monitoring (called after sign-in)
      async startSessionMonitoring(user) {
        try {
          // Generate session ID for this device
          this._sessionId = this.generateSessionId();
          console.log('[Session] Starting monitoring, session ID:', this._sessionId);
          
          const sessionRef = database.ref('users/' + user.uid + '/activeSession');
          
          // Write our session ID to Firebase
          await sessionRef.set({
            sessionId: this._sessionId,
            deviceInfo: navigator.userAgent.substr(0, 100),
            loginTime: Date.now()
          });
          
          console.log('[Session] âœ… Session registered in Firebase');
          
          // Listen for changes to the active session
          this._sessionListener = sessionRef.on('value', (snapshot) => {
            const activeSession = snapshot.val();
            
            if (activeSession && activeSession.sessionId !== this._sessionId) {
              console.warn('[Session] âš ï¸ Another device has signed in!');
              this.handleSessionConflict();
            }
          });
          
        } catch (error) {
          console.error('[Session] Failed to start monitoring:', error);
        }
      },
      
      // Handle session conflict (another device signed in)
      handleSessionConflict() {
        // Stop listening to prevent multiple alerts
        if (this._sessionListener) {
          const sessionRef = database.ref('users/' + this.currentUser.uid + '/activeSession');
          sessionRef.off('value', this._sessionListener);
          this._sessionListener = null;
        }
        
        // Show alert to user
        alert('âš ï¸ Your account has been logged in on another device. You have been signed out here.');
        
        // Sign out
        this.signOut();
      },
      
      // Stop session monitoring (called on sign-out)
      async stopSessionMonitoring() {
        try {
          if (this._sessionListener && this.currentUser) {
            const sessionRef = database.ref('users/' + this.currentUser.uid + '/activeSession');
            
            // Remove listener
            sessionRef.off('value', this._sessionListener);
            this._sessionListener = null;
            
            // Clear session from Firebase
            await sessionRef.remove();
            
            console.log('[Session] Session monitoring stopped');
          }
        } catch (error) {
          console.error('[Session] Error stopping session monitoring:', error);
        }
      }
