        'hospital': { width: 4, height: 4 },
        'gunShop': { width: 2, height: 2 },
        'chopShop': { width: 3, height: 3 },
        'casino': { width: 4, height: 4 },
        'nightclub': { width: 3, height: 3 },
        'bank': { width: 4, height: 4 },
