    /**
     * Update Turf Defense mode logic
     * Called each frame when defense mode is active
     * @param {number} dt - Delta time in seconds since last update
     */
    function updateTurfDefense(dt) {
      // Track call count for conditional logging
      if (!GameState.turfDefense._updateCallCount) GameState.turfDefense._updateCallCount = 0;
      GameState.turfDefense._updateCallCount++;
      const callCount = GameState.turfDefense._updateCallCount;

      // Log first 3 calls and every 120th call (every 2 seconds at 60fps)
      const shouldLog = callCount <= 3 || callCount % 120 === 0;

      if (shouldLog) {
        console.log(`âš™ï¸ [updateTurfDefense] Call #${callCount}, dt: ${dt.toFixed(4)}, active: ${GameState.turfDefense.active}`);
      }

      if (!GameState.turfDefense.active) {
        console.warn(`âš ï¸ [updateTurfDefense] EARLY RETURN - active is FALSE (call #${callCount})`);
        return;
      }

      // DEBUG: Mark that update was called
      if (DEBUG_OVERLAY_ENABLED) {
        DebugOverlay.markUpdate(dt);
        if (shouldLog) {
          console.log(`  âœ… Update marked (call #${callCount})`);
        }
      }

      const defense = GameState.turfDefense;
      const now = Date.now();

      // Input safety: consume one-shot inputs to prevent stuck states
      // Ultimate is one-shot (tap once to activate)
      if (defense.input && defense.input.ultimate) {
        // TODO: Trigger ultimate ability here when implemented
        defense.input.ultimate = false; // Consume immediately
      }
      // Note: shooting and spraying are hold inputs, kept true while held

      // Sync structure positions/bounds from real building refs
      // Ensures structures stay aligned with real turf buildings (single source of truth)
      syncDefenseStructuresFromRefs();

      // Update based on wave state
      switch (defense.waveState) {
        case 'preparing':
          // Preparation phase - countdown to wave start
          // TODO: Show countdown timer
          break;

        case 'active':
          // Active wave - spawn enemies, update combat, check win conditions

          // Spawn enemies at start of wave (if not already spawned)
          if (defense.enemies.length === 0 && now - defense.waveStartTime < 100) {
            spawnWaveEnemies();
          }

          // Get canvas dimensions for bounds checking
          const mapWidth = (GameState.map && GameState.map.width) || 30;
          const mapHeight = (GameState.map && GameState.map.height) || 30;
          const tileSize = 30;
          const canvasWidth = mapWidth * tileSize;
          const canvasHeight = mapHeight * tileSize;

          // Update player movement from joystick
          const movement = TouchControls.getMovement();
          if (!defense.playerX) defense.playerX = canvasWidth / 2;
          if (!defense.playerY) defense.playerY = canvasHeight / 2;

          defense.playerX += movement.x * TurfDefenseConfig.PLAYER_SPEED * dt;
          defense.playerY += movement.y * TurfDefenseConfig.PLAYER_SPEED * dt;

          // Clamp player to canvas bounds
          defense.playerX = Math.max(20, Math.min(canvasWidth - 20, defense.playerX));
          defense.playerY = Math.max(20, Math.min(canvasHeight - 20, defense.playerY));

          // Update player sprite state
          if (defense.playerSprite) {
            const sprite = defense.playerSprite;
            const isMoving = Math.abs(movement.x) > 0.1 || Math.abs(movement.y) > 0.1;
            sprite.isMoving = isMoving;

            // Update facing angle based on movement direction
            if (isMoving) {
              sprite.facingAngle = Math.atan2(movement.y, movement.x) + Math.PI / 2;
            }

            // Find nearest enemy for aiming when shooting
            let nearestEnemyForAim = null;
            let nearestDistForAim = TurfDefenseConfig.PLAYER_SHOOT_RANGE * 1.5;
            defense.enemies.forEach(enemy => {
              if (enemy.state === 'dead') return;
              const dist = Math.sqrt(
                Math.pow(enemy.x - defense.playerX, 2) + Math.pow(enemy.y - defense.playerY, 2)
              );
              if (dist < nearestDistForAim) {
                nearestDistForAim = dist;
                nearestEnemyForAim = enemy;
              }
            });

            // Update facing angle when shooting/aiming at enemy
            if (nearestEnemyForAim && (defense.input.shooting || defense.input.spraying)) {
              const dx = nearestEnemyForAim.x - defense.playerX;
              const dy = nearestEnemyForAim.y - defense.playerY;
              sprite.facingAngle = Math.atan2(dy, dx) + Math.PI / 2;
            }

            // Determine animation state
            let newAnim = 'idle';
            if (defense.isReloading) {
              newAnim = 'reload';
            } else if (now < sprite.shootAnimEndTime) {
              newAnim = 'shoot';
            } else if (isMoving) {
              newAnim = 'move';
            }

            // Reset frame if animation changed
            if (sprite.anim !== newAnim) {
              sprite.anim = newAnim;
              sprite.bodyFrame = 0;
              sprite.lastBodyFrameTime = now;
            }

            // Update body animation frame
            const bodyFrameRate = PlayerSpriteManager.getFrameRate(sprite.anim);
            const bodyFrameDuration = 1000 / bodyFrameRate;
            if (now - sprite.lastBodyFrameTime >= bodyFrameDuration) {
              const bodyFrames = PlayerSpriteManager.getBodyFrames(sprite.anim);
              if (bodyFrames && bodyFrames.length > 0) {
                sprite.bodyFrame = (sprite.bodyFrame + 1) % bodyFrames.length;
                sprite.lastBodyFrameTime = now;

                // Special handling for shoot animation - only play once
                if (sprite.anim === 'shoot' && sprite.bodyFrame === 0) {
                  sprite.shootAnimEndTime = 0; // Animation complete
                }
              }
            }

            // Update feet animation frame
            const feetFrameRate = PlayerSpriteManager.config.frameRate;
            const feetFrameDuration = 1000 / feetFrameRate;
            if (now - sprite.lastFeetFrameTime >= feetFrameDuration) {
              const feetFrames = PlayerSpriteManager.getFeetFrames(isMoving);
              if (feetFrames && feetFrames.length > 0) {
                sprite.feetFrame = (sprite.feetFrame + 1) % feetFrames.length;
                sprite.lastFeetFrameTime = now;
              }
            }

            // Update muzzle flash visibility
            if (now > sprite.muzzleFlashEndTime) {
              sprite.showMuzzleFlash = false;
            }
          }

          // Handle player shooting input (continuous)
          if (defense.input.shooting && now - defense.lastShootTime >= TurfDefenseConfig.PLAYER_SHOOT_FIRE_RATE) {
            // Find nearest enemy and shoot
            let nearestEnemy = null;
            let nearestDist = TurfDefenseConfig.PLAYER_SHOOT_RANGE;

            defense.enemies.forEach(enemy => {
              if (enemy.state === 'dead') return;

              const dist = Math.sqrt(
                Math.pow(enemy.x - defense.playerX, 2) + Math.pow(enemy.y - defense.playerY, 2)
              );

              if (dist < nearestDist) {
                nearestDist = dist;
                nearestEnemy = enemy;
              }
            });

            if (nearestEnemy) {
              playerShootAtPosition(nearestEnemy.x, nearestEnemy.y);
              defense.lastShootTime = now;
            }
          }

          // Handle player spraying input (continuous)
          if (defense.input.spraying && now - defense.lastSprayTime >= TurfDefenseConfig.PLAYER_SPRAY_FIRE_RATE) {
            // Spray damages all enemies in range (area damage)
            let hitCount = 0;

            defense.enemies.forEach(enemy => {
              if (enemy.state === 'dead') return;

              const dist = Math.sqrt(
                Math.pow(enemy.x - defense.playerX, 2) + Math.pow(enemy.y - defense.playerY, 2)
              );

              // Spray has shorter range than shooting
              if (dist < TurfDefenseConfig.PLAYER_SHOOT_RANGE * 0.7) {
                const damage = TurfDefenseConfig.PLAYER_SPRAY_DAMAGE;
                enemy.hp -= damage;

                // Spawn damage number
                spawnDamageNumber(enemy.x, enemy.y - 20, damage, 'damage');

                // Aggro enemy when sprayed
                if (!enemy.aggroed) {
                  enemy.aggroed = true;
                  console.log(`ðŸ˜¡ [Enemy ${enemy.id}] Aggroed by spray!`);
                }

                // Check if enemy died
                if (enemy.hp <= 0) {
                  enemy.state = 'dead';
                  defense.enemiesKilled++;
                  defense.totalScore += 100;
                  console.log(`ðŸ’€ [Enemy ${enemy.id}] Killed by spray! Total kills: ${defense.enemiesKilled}`);
                  spawnLoot(enemy.x, enemy.y);

                  // Remove dead enemy after short delay
                  setTimeout(() => {
                    const idx = defense.enemies.indexOf(enemy);
                    if (idx !== -1) defense.enemies.splice(idx, 1);
                  }, 2000);
                }

                hitCount++;
              }
            });

            if (hitCount > 0) {
              console.log(`ðŸ’¨ [Spray] Hit ${hitCount} enemies!`);
              defense.lastSprayTime = now;
            }
          }

          // Update all enemies
          defense.enemies.forEach(enemy => {
            updateEnemyAI(enemy, dt, defense);

            // Lerp enemy visual HP toward actual HP
            const lerpSpeed = TurfDefenseConfig.HP_BAR_LERP_SPEED;
            enemy.visualHP += (enemy.hp - enemy.visualHP) * lerpSpeed;

            // PHASE 3D: Decay enemy attack animation timer
            if (enemy.attackAnimT > 0) {
              enemy.attackAnimT -= dt * 1000; // Convert dt to ms
              if (enemy.attackAnimT < 0) enemy.attackAnimT = 0;
            }
          });

          // PHASE 3D: Decay structure hit feedback timers
          if (defense.structures) {
            defense.structures.forEach(structure => {
              if (structure.hitFlashT > 0) {
                structure.hitFlashT -= dt * 1000; // Convert dt to ms
                if (structure.hitFlashT < 0) structure.hitFlashT = 0;
              }
              if (structure.hitShakeT > 0) {
                structure.hitShakeT -= dt * 1000; // Convert dt to ms
                if (structure.hitShakeT < 0) structure.hitShakeT = 0;
              }
            });
          }

          // Lerp player visual HP toward actual HP
          const lerpSpeed = TurfDefenseConfig.HP_BAR_LERP_SPEED;
          defense.playerVisualHP += (defense.playerHP - defense.playerVisualHP) * lerpSpeed;

          // Update damage numbers
          updateDamageNumbers(dt);

          // Update loot pickups
          updateLootPickups(dt);

          // Check wave completion (all enemies dead)
          // Safety: Ensure enemies array exists
          if (!Array.isArray(defense.enemies)) defense.enemies = [];
          const aliveEnemies = defense.enemies.filter(e => e.state !== 'dead');
          if (aliveEnemies.length === 0 && defense.enemies.length > 0) {
            defense.waveState = 'complete';
            console.log('âœ… [TurfDefense] All enemies eliminated!');
          }

          // Check failure conditions
          // 1. Check if main base (critical structure) is destroyed
          const mainBase = defense.structures ? defense.structures.find(s => s.isCritical) : null;
          if (mainBase && mainBase.hp <= 0) {
            defense.waveState = 'failed';
            endTurfDefense('base_destroyed');
          } else if (defense.playerHP <= 0) {
            defense.waveState = 'failed';
            endTurfDefense('player_down');
          }

          break;

        case 'complete':
          // Wave completed - prepare for next wave
          console.log('âœ… [TurfDefense] Wave', defense.wave, 'complete!');

          // Check for victory (wave 5 complete)
          if (defense.wave >= 5) {
            console.log('ðŸŽ‰ [TurfDefense] VICTORY! All waves completed!');
            endTurfDefense('victory');
            defense.waveState = 'inactive';
            return;
          }

          // Prepare next wave after delay
          setTimeout(() => {
            if (defense.active && defense.waveState === 'complete') {
              defense.wave++;
              defense.waveState = 'preparing';
              defense.waveStartTime = now;
              console.log('ðŸŒŠ [TurfDefense] Starting wave', defense.wave);

              // Auto-start next wave after prep time
              setTimeout(() => {
                if (defense.active && defense.waveState === 'preparing') {
                  defense.waveState = 'active';
                  defense.waveStartTime = now;
                }
              }, 3000);
            }
          }, 2000);

          defense.waveState = 'inactive'; // Prevent multiple triggers
          break;

        case 'failed':
          // Wave failed - end session
          console.log('âŒ [TurfDefense] Defense failed on wave', defense.wave);
          endTurfDefense('failed');
          break;
      }

      // Debug logging (remove in production)
      if (Math.floor(now / 1000) % 10 === 0 && now % 1000 < 16) {
        console.log('[TurfDefense] Active -', 'Wave:', defense.wave, 'State:', defense.waveState, 'Enemies:', defense.enemies.length);
      }
    }

    /**
     * Draw/render Turf Defense mode
     * Handles rendering of defense-specific UI and entities
     */
    function drawTurfDefense() {
      // Track call count for conditional logging
      if (!GameState.turfDefense._drawCallCount) GameState.turfDefense._drawCallCount = 0;
      GameState.turfDefense._drawCallCount++;
      const callCount = GameState.turfDefense._drawCallCount;

      // Log first 3 calls and every 120th call (every 2 seconds at 60fps)
      const shouldLog = callCount <= 3 || callCount % 120 === 0;

      if (shouldLog) {
        console.log(`ðŸŽ¨ [drawTurfDefense] Call #${callCount}, active: ${GameState.turfDefense.active}, canvas: ${!!TurfDefenseRenderer.canvas}, ctx: ${!!TurfDefenseRenderer.ctx}`);
      }

      if (!GameState.turfDefense.active) {
        if (shouldLog) {
          console.log(`[drawTurfDefense] Defense not active, skipping (call #${callCount})`);
        }
        return;
      }

      const defense = GameState.turfDefense;
      let canvas = TurfDefenseRenderer.canvas;
      let ctx = TurfDefenseRenderer.ctx;

      // Retry initialization if canvas doesn't exist yet (timing issue)
      if (!canvas || !ctx) {
        if (shouldLog) {
          console.log(`[drawTurfDefense] Canvas not ready, attempting init (call #${callCount})`);
        }
        TurfDefenseRenderer.init();
        canvas = TurfDefenseRenderer.canvas;
        ctx = TurfDefenseRenderer.ctx;

        // Still null after init? City-map element not ready yet
        if (!canvas || !ctx) {
          if (shouldLog) {
            console.log(`[drawTurfDefense] Canvas still not ready after init attempt (call #${callCount})`);
          }
          return;
        }
      }

      // DEBUG: Mark that draw was called
      if (DEBUG_OVERLAY_ENABLED) {
        DebugOverlay.markDraw();
        if (shouldLog) {
          console.log(`  âœ… Draw marked (call #${callCount})`);
        }
      }

      // Clear canvas with transparency (so we can see the map below)
      ctx.clearRect(0, 0, canvas.width, canvas.height);

      // Render building HP bars (only during defense)
      if (defense.structures) {
        // DEBUG: Log structures being rendered (only once per wave start)
        if (!defense._structuresLogged) {
          console.log(`ðŸŽ¨ [Renderer] Drawing ${defense.structures.length} structures:`);
          defense.structures.forEach((s, i) => {
            console.log(`  [${i}] ${s.name} at (${s.x}, ${s.y}) HP: ${s.hp}/${s.hpMax} Critical: ${s.isCritical}`);
          });
          defense._structuresLogged = true;
        }

        defense.structures.forEach(structure => {
          TurfDefenseRenderer.drawStructureHP(ctx, structure);
        });
      }

      // Render enemies
      defense.enemies.forEach(enemy => {
        TurfDefenseRenderer.drawEnemy(ctx, enemy);
      });

      // Render loot drops
      TurfDefenseRenderer.drawLoot(ctx, defense);

      // Render player
      TurfDefenseRenderer.drawPlayer(ctx, defense);

      // Render floating damage numbers
      TurfDefenseRenderer.drawDamageNumbers(ctx, defense);

      // Render HUD
      TurfDefenseRenderer.drawHUD(ctx, defense, canvas.width, canvas.height);

      // DEBUG: Draw debug overlay (LAST - drawn on top)
      if (DEBUG_OVERLAY_ENABLED) {
        DebugOverlay.draw(ctx, canvas);
      }
    }

