    /**
     * Create a new enemy entity
     */
    function createEnemy(id, spawnPos) {
      return {
        id: id,
        x: spawnPos.x,
        y: spawnPos.y,
        hp: TurfDefenseConfig.ENEMY_HP,
        maxHP: TurfDefenseConfig.ENEMY_HP,
        visualHP: TurfDefenseConfig.ENEMY_HP, // For smooth HP bar animation
        state: 'moving', // 'moving' | 'attackingBuilding' | 'attackingPlayer' | 'dead'
        targetBuildingId: 'mainBase', // Default target
        aggroed: false,
        lastAttackTime: 0,
        velocity: { x: 0, y: 0 },
        // PHASE 3D: Attack animation timer
        attackAnimT: 0
      };
    }

    /**
     * Spawn enemies for current wave
     */
    function spawnWaveEnemies() {
      const defense = GameState.turfDefense;
      const wave = defense.wave;
      const enemyCount = TurfDefenseConfig.WAVE_ENEMIES[wave] || 10;

      console.log(`ðŸŒŠ [TurfDefense] Spawning ${enemyCount} enemies for wave ${wave}`);

      // Get map dimensions
      const mapWidth = (GameState.map && GameState.map.width) || 30;
      const mapHeight = (GameState.map && GameState.map.height) || 30;
      const tileSize = 30;
      const canvasWidth = mapWidth * tileSize;
      const canvasHeight = mapHeight * tileSize;

      // Generate spawn positions around edges of map
      const spawnPositions = [];
      const enemySpriteRadius = 15; // Enemy circle radius from drawEnemy()
      const margin = 70; // Increased margin to account for enemy sprite size (15px radius + buffer)
      const numSpawns = Math.max(8, enemyCount);

      for (let i = 0; i < numSpawns; i++) {
        const angle = (i / numSpawns) * Math.PI * 2;
        const radius = Math.min(canvasWidth, canvasHeight) / 2 - margin;
        const x = canvasWidth / 2 + Math.cos(angle) * radius;
        const y = canvasHeight / 2 + Math.sin(angle) * radius;
        spawnPositions.push({ x, y });
      }

      // Find main base and other structures
      const mainBase = defense.structures ? defense.structures.find(s => s.isCritical) : null;
      const structures = defense.structures || [];

      // Filter for safe structures (not near edges) for initial targeting
      const safeStructures = structures.filter(s => !s.nearEdge && s.hp > 0);
      const hasOnlySafeStructures = safeStructures.length > 0;

      console.log(`ðŸŽ¯ [Spawn] ${safeStructures.length}/${structures.length} structures are safe for targeting`);

      for (let i = 0; i < enemyCount; i++) {
        const spawnPos = spawnPositions[i % spawnPositions.length];
        const enemy = createEnemy(`enemy_${wave}_${i}`, spawnPos);

        // Assign target structure (prefer main base, but distribute across SAFE structures)
        if (mainBase && (i % 3 === 0 || structures.length === 1)) {
          enemy.targetStructureId = mainBase.id;
        } else if (hasOnlySafeStructures) {
          // Prefer safe non-critical structures
          const safeNonCritical = safeStructures.filter(s => !s.isCritical);
          if (safeNonCritical.length > 0) {
            const target = safeNonCritical[i % safeNonCritical.length];
            enemy.targetStructureId = target.id;
          } else {
            // All safe structures are critical, use them anyway
            const target = safeStructures[i % safeStructures.length];
            enemy.targetStructureId = target.id;
          }
        } else if (structures.length > 1) {
          // No safe structures, fall back to any non-critical structure
          const nonCritical = structures.filter(s => !s.isCritical && s.hp > 0);
          if (nonCritical.length > 0) {
            const target = nonCritical[i % nonCritical.length];
            enemy.targetStructureId = target.id;
          } else {
            enemy.targetStructureId = mainBase ? mainBase.id : structures[0].id;
          }
        } else {
          enemy.targetStructureId = mainBase ? mainBase.id : (structures[0] ? structures[0].id : null);
        }

        defense.enemies.push(enemy);
      }

      defense.lastSpawnTime = Date.now();

      // DEBUG: Log spawn results
      if (DEBUG_OVERLAY_ENABLED) {
        console.log(`  Spawned ${enemyCount} enemies in pixel coords:`);
        console.log(`    Canvas size: ${canvasWidth}x${canvasHeight}`);
        if (defense.enemies.length > 0) {
          const minX = Math.min(...defense.enemies.map(e => e.x));
          const maxX = Math.max(...defense.enemies.map(e => e.x));
          const minY = Math.min(...defense.enemies.map(e => e.y));
          const maxY = Math.max(...defense.enemies.map(e => e.y));
          console.log(`    Enemy bounds: X[${minX.toFixed(0)}-${maxX.toFixed(0)}] Y[${minY.toFixed(0)}-${maxY.toFixed(0)}]`);
        }
      }
    }

    /**
     * Update enemy AI and behavior
     */
    function updateEnemyAI(enemy, dt, defense) {
      if (enemy.state === 'dead') return;

      const playerX = defense.playerX || (GameState.map ? (GameState.map.width * 15) : 450);
      const playerY = defense.playerY || (GameState.map ? (GameState.map.height * 15) : 450);

      // Check for proximity aggro (if player gets too close)
      if (!enemy.aggroed) {
        const distToPlayer = Math.sqrt(
          Math.pow(enemy.x - playerX, 2) + Math.pow(enemy.y - playerY, 2)
        );

        if (distToPlayer < TurfDefenseConfig.ENEMY_AGGRO_RADIUS) {
          enemy.aggroed = true;
          console.log(`âš ï¸ [Enemy ${enemy.id}] Aggroed by proximity!`);
        }
      }

      // Determine target based on aggro state
      let targetX, targetY, targetType;

      if (enemy.aggroed) {
        // Aggroed: target player
        targetX = playerX;
        targetY = playerY;
        targetType = 'player';
      } else {
        // Not aggroed: target assigned structure
        const structure = defense.structures ? defense.structures.find(s => s.id === enemy.targetStructureId) : null;
        if (structure && structure.hp > 0) {
          targetX = structure.x;
          targetY = structure.y;
          targetType = 'structure';
        } else {
          // If target structure is destroyed/invalid, find new target (prefer safe structures)
          const aliveStructures = defense.structures ? defense.structures.filter(s => s.hp > 0) : [];
          if (aliveStructures.length > 0) {
            // Prefer safe structures (not near edges)
            const safeAlive = aliveStructures.filter(s => !s.nearEdge);
            const candidatePool = safeAlive.length > 0 ? safeAlive : aliveStructures;

            // Find nearest structure from candidate pool
            let nearestDist = Infinity;
            let nearest = null;
            candidatePool.forEach(s => {
              const dist = Math.sqrt(Math.pow(s.x - enemy.x, 2) + Math.pow(s.y - enemy.y, 2));
              if (dist < nearestDist) {
                nearestDist = dist;
                nearest = s;
              }
            });
            if (nearest) {
              enemy.targetStructureId = nearest.id;
              targetX = nearest.x;
              targetY = nearest.y;
              targetType = 'structure';
            }
          }
        }
      }

      // If no valid target, do nothing
      if (!targetX || !targetY) return;

      // Calculate distance to target
      const dx = targetX - enemy.x;
      const dy = targetY - enemy.y;
      const distToTarget = Math.sqrt(dx * dx + dy * dy);

      // Check if in attack range
      if (distToTarget < TurfDefenseConfig.ENEMY_ATTACK_RANGE) {
        // In range - attack
        enemy.velocity.x = 0;
        enemy.velocity.y = 0;

        if (targetType === 'player') {
          enemy.state = 'attackingPlayer';
          tryEnemyAttackPlayer(enemy, defense);
        } else {
          enemy.state = 'attackingBuilding';
          tryEnemyAttackStructure(enemy, defense);
        }
      } else {
        // Out of range - move toward target
        enemy.state = 'moving';

        // Normalize direction and apply speed
        const dirX = dx / distToTarget;
        const dirY = dy / distToTarget;

        enemy.velocity.x = dirX * TurfDefenseConfig.ENEMY_SPEED;
        enemy.velocity.y = dirY * TurfDefenseConfig.ENEMY_SPEED;

        // Update position
        const oldX = enemy.x;
        const oldY = enemy.y;
        enemy.x += enemy.velocity.x * dt;
        enemy.y += enemy.velocity.y * dt;

        // Clamp enemy to map bounds (prevent wandering outside map)
        const mapWidth = (GameState.map && GameState.map.width) || 30;
        const mapHeight = (GameState.map && GameState.map.height) || 30;
        const tileSize = 30;
        const canvasWidth = mapWidth * tileSize;
        const canvasHeight = mapHeight * tileSize;
        const enemyRadius = 15; // Enemy sprite radius

        const clampedX = Math.max(enemyRadius, Math.min(canvasWidth - enemyRadius, enemy.x));
        const clampedY = Math.max(enemyRadius, Math.min(canvasHeight - enemyRadius, enemy.y));

        // Detect if enemy was clamped (stuck at boundary)
        const wasClamped = (clampedX !== enemy.x) || (clampedY !== enemy.y);

        enemy.x = clampedX;
        enemy.y = clampedY;

        // If enemy is stuck at boundary, check if we should pick a new target
        if (wasClamped && !enemy.aggroed) {
          // Initialize stuck tracking if not exists
          if (!enemy.stuckAtBoundary) {
            enemy.stuckAtBoundary = true;
            enemy.stuckStartTime = Date.now();
          } else {
            // If stuck for more than 1 second, pick a new target away from edges
            const stuckDuration = Date.now() - enemy.stuckStartTime;
            if (stuckDuration > 1000) {
              // Find structures that are not near map edges (use nearEdge flag)
              const safeStructures = defense.structures ? defense.structures.filter(s =>
                s.hp > 0 && !s.nearEdge
              ) : [];

              if (safeStructures.length > 0) {
                // Pick a random safe structure
                const newTarget = safeStructures[Math.floor(Math.random() * safeStructures.length)];
                enemy.targetStructureId = newTarget.id;
                enemy.stuckAtBoundary = false;
                enemy.stuckStartTime = null;
                console.log(`ðŸ”„ [Enemy ${enemy.id}] Stuck at boundary, retargeting to safe structure: ${newTarget.name}`);
              } else {
                // No safe structures, pick the nearest alive one (even if near edge)
                const allAlive = defense.structures ? defense.structures.filter(s => s.hp > 0) : [];
                if (allAlive.length > 0) {
                  let nearestDist = Infinity;
                  let nearest = null;
                  allAlive.forEach(s => {
                    const dist = Math.sqrt(Math.pow(s.x - enemy.x, 2) + Math.pow(s.y - enemy.y, 2));
                    if (dist < nearestDist) {
                      nearestDist = dist;
                      nearest = s;
                    }
                  });
                  if (nearest) {
                    enemy.targetStructureId = nearest.id;
                    enemy.stuckAtBoundary = false;
                    enemy.stuckStartTime = null;
                    console.warn(`âš ï¸ [Enemy ${enemy.id}] No safe structures, targeting nearest: ${nearest.name} (near edge)`);
                  }
                }
              }
            }
          }
        } else {
          // Reset stuck tracking if enemy is moving freely
          enemy.stuckAtBoundary = false;
          enemy.stuckStartTime = null;
        }
      }
    }

    // ========================================
    // TURF DEFENSE: DAMAGE NUMBER SYSTEM
    // ========================================

    /**
     * Spawn a floating damage number
     * @param {number} x - X position
     * @param {number} y - Y position
     * @param {number} value - Damage value
     * @param {string} type - 'damage' | 'heal' | 'crit'
     */
    function spawnDamageNumber(x, y, value, type = 'damage') {
      const defense = GameState.turfDefense;
      if (!defense.active) return;

      // Limit max damage numbers for performance
      if (defense.damageNumbers.length >= TurfDefenseConfig.MAX_DAMAGE_NUMBERS) {
        defense.damageNumbers.shift(); // Remove oldest
      }

      // Create damage number
      const damageNumber = {
        x: x,
        y: y,
        startY: y,
        value: value,
        type: type,
        startTime: Date.now(),
        alpha: 1.0
      };

      defense.damageNumbers.push(damageNumber);
    }

    /**
     * Update all damage numbers (called each frame)
     * @param {number} dt - Delta time in seconds
     */
    function updateDamageNumbers(dt) {
      const defense = GameState.turfDefense;
      if (!defense.active) return;

      // Safety: Ensure damageNumbers array exists
      if (!Array.isArray(defense.damageNumbers)) {
        console.warn('âš ï¸ [updateDamageNumbers] damageNumbers is not an array, initializing...');
        defense.damageNumbers = [];
        return;
      }

      const now = Date.now();

      // Update and remove expired damage numbers
      defense.damageNumbers = defense.damageNumbers.filter(dmg => {
        const elapsed = now - dmg.startTime;
        const progress = elapsed / TurfDefenseConfig.DAMAGE_NUMBER_DURATION;

        if (progress >= 1.0) {
          return false; // Remove expired
        }

        // Float upward
        dmg.y = dmg.startY - (progress * TurfDefenseConfig.DAMAGE_NUMBER_RISE_SPEED);

        // Fade out
        dmg.alpha = 1.0 - progress;

        return true; // Keep
      });
    }

