        this.joystickKnob.style.transform = 'translate(0, 0)';
        this.movement.x = 0;
        this.movement.y = 0;

        // Reset input state
        if (GameState.turfDefense && GameState.turfDefense.input) {
          GameState.turfDefense.input.moveX = 0;
          GameState.turfDefense.input.moveY = 0;
        }
