          const inView = enemies.filter(e =>
            e.x >= 0 && e.x <= canvas.width &&
            e.y >= 0 && e.y <= canvas.height
          ).length;
          drawLine(`In Viewport: ${inView}/${enemies.length}`, inView > 0 ? '#0F0' : '#FFA500');
