    // ========================================
    // ROAD-MASK PATHFINDING (A* on a grid) for Cop Patrol
    // ========================================
    const RoadPathfinder = (() => {
      const state = {
        ready: false,
        cellSize: 8,          // px per grid cell (tradeoff: accuracy vs performance)
        w: 0, h: 0,           // image size in px
        gw: 0, gh: 0,         // grid size in cells
        walkable: null,       // Uint8Array (1 = road)
      };

      function clamp(v, a, b) { return Math.max(a, Math.min(b, v)); }

      function rgbToHsv(r, g, b) {
        r/=255; g/=255; b/=255;
        const max = Math.max(r,g,b), min = Math.min(r,g,b);
        const d = max - min;
        let h = 0;
        const s = max === 0 ? 0 : d / max;
        const v = max;
        if (d !== 0) {
          switch (max) {
            case r: h = ((g - b) / d + (g < b ? 6 : 0)); break;
            case g: h = ((b - r) / d + 2); break;
            case b: h = ((r - g) / d + 4); break;
          }
          h /= 6;
        }
        return { h, s, v };
      }

      function isRoadPixel(r, g, b, a) {
        if (a < 10) return false;

        // Roads on your map are bright + low saturation (beige/grey/white),
        // while parks/water are higher saturation (greens/blues).
        const { s, v } = rgbToHsv(r,g,b);

        const bright = v > 0.72;
        const lowSat = s < 0.22;

        // Extra guard: reject very-green pixels (parks)
        const veryGreen = (g > r + 25) && (g > b + 25);

        return bright && lowSat && !veryGreen;
      }

      function idx(gx, gy) { return gy * state.gw + gx; }

      function inBounds(gx, gy) {
        return gx >= 0 && gy >= 0 && gx < state.gw && gy < state.gh;
      }

      function buildFromImage(imgEl) {
        try {
          const canvas = document.createElement('canvas');
          canvas.width = imgEl.naturalWidth || imgEl.width;
          canvas.height = imgEl.naturalHeight || imgEl.height;

          state.w = canvas.width;
          state.h = canvas.height;

          const ctx = canvas.getContext('2d', { willReadFrequently: true });
          ctx.drawImage(imgEl, 0, 0);

          state.gw = Math.max(1, Math.floor(state.w / state.cellSize));
          state.gh = Math.max(1, Math.floor(state.h / state.cellSize));
          state.walkable = new Uint8Array(state.gw * state.gh);

          const imgData = ctx.getImageData(0, 0, state.w, state.h).data;

          // Sample the center pixel of each cell to classify road vs not-road
          for (let gy = 0; gy < state.gh; gy++) {
            for (let gx = 0; gx < state.gw; gx++) {
              const px = clamp(Math.floor((gx + 0.5) * state.cellSize), 0, state.w - 1);
              const py = clamp(Math.floor((gy + 0.5) * state.cellSize), 0, state.h - 1);
              const p = (py * state.w + px) * 4;
              const r = imgData[p], g = imgData[p+1], b = imgData[p+2], a = imgData[p+3];
              state.walkable[idx(gx,gy)] = isRoadPixel(r,g,b,a) ? 1 : 0;
            }
          }

          // Light dilation to connect slightly broken road samples
          dilate(1);

          state.ready = true;
          console.log(`ðŸ›£ï¸ RoadPathfinder ready: ${state.gw}x${state.gh} grid, cellSize=${state.cellSize}px`);
        } catch (e) {
          console.warn('RoadPathfinder failed to initialize (will fall back to straight lines):', e);
          state.ready = false;
        }
      }

      function dilate(radiusCells) {
        if (!state.walkable) return;
        const src = state.walkable;
        const dst = new Uint8Array(src.length);

        for (let gy = 0; gy < state.gh; gy++) {
          for (let gx = 0; gx < state.gw; gx++) {
            const i0 = idx(gx,gy);
            if (src[i0]) { dst[i0]=1; continue; }
            let found = false;
            for (let dy = -radiusCells; dy <= radiusCells && !found; dy++) {
              for (let dx = -radiusCells; dx <= radiusCells; dx++) {
                const nx = gx+dx, ny = gy+dy;
                if (inBounds(nx,ny) && src[idx(nx,ny)]) { found=true; break; }
              }
            }
            dst[i0] = found ? 1 : 0;
          }
        }
        state.walkable = dst;
      }

      function percentToGrid(pt) {
        const gx = clamp(Math.round((pt.x / 100) * (state.gw - 1)), 0, state.gw - 1);
        const gy = clamp(Math.round((pt.y / 100) * (state.gh - 1)), 0, state.gh - 1);
        return { gx, gy };
      }

      function gridToPercent(gx, gy) {
        return {
          x: (gx / (state.gw - 1)) * 100,
          y: (gy / (state.gh - 1)) * 100
        };
      }

      function nearestRoadCell(gx, gy, maxRadius = 12) {
        if (!state.walkable) return { gx, gy };
        if (state.walkable[idx(gx,gy)]) return { gx, gy };

        for (let r = 1; r <= maxRadius; r++) {
          for (let dy = -r; dy <= r; dy++) {
            for (let dx = -r; dx <= r; dx++) {
              if (Math.abs(dx) !== r && Math.abs(dy) !== r) continue; // perimeter
              const nx = gx + dx, ny = gy + dy;
              if (inBounds(nx,ny) && state.walkable[idx(nx,ny)]) return { gx: nx, gy: ny };
            }
          }
        }
        return { gx, gy }; // fallback
      }

      function aStar(start, goal) {
        const { gw, gh, walkable } = state;
        const startId = idx(start.gx, start.gy);
        const goalId = idx(goal.gx, goal.gy);

        const open = new MinHeap();
        const cameFrom = new Int32Array(gw * gh);
        const gScore = new Float32Array(gw * gh);
        const fScore = new Float32Array(gw * gh);
        const inOpen = new Uint8Array(gw * gh);
        const closed = new Uint8Array(gw * gh);

        cameFrom.fill(-1);
        gScore.fill(Infinity);
        fScore.fill(Infinity);

        function h(a, b) { return Math.abs(a.gx - b.gx) + Math.abs(a.gy - b.gy); }

        gScore[startId] = 0;
        fScore[startId] = h(start, goal);
        open.push({ id: startId, f: fScore[startId] });
        inOpen[startId] = 1;

        const dirs = [
          {dx:1,dy:0},{dx:-1,dy:0},{dx:0,dy:1},{dx:0,dy:-1},
          {dx:1,dy:1},{dx:1,dy:-1},{dx:-1,dy:1},{dx:-1,dy:-1},
        ];

        while (!open.isEmpty()) {
          const current = open.pop();
          const cid = current.id;
          if (closed[cid]) continue;
          closed[cid] = 1;

          if (cid === goalId) {
            // reconstruct
            const path = [];
            let cur = cid;
            while (cur !== -1) {
              const gx = cur % gw;
              const gy = (cur / gw) | 0;
              path.push({ gx, gy });
              cur = cameFrom[cur];
            }
            path.reverse();
            return path;
          }

          const cx = cid % gw;
          const cy = (cid / gw) | 0;

          for (const d of dirs) {
            const nx = cx + d.dx, ny = cy + d.dy;
            if (!inBounds(nx,ny)) continue;
            const nid = idx(nx,ny);
            if (closed[nid]) continue;
            if (!walkable[nid]) continue;

            const stepCost = (d.dx === 0 || d.dy === 0) ? 1 : 1.4;
            const tentativeG = gScore[cid] + stepCost;
            if (tentativeG < gScore[nid]) {
              cameFrom[nid] = cid;
              gScore[nid] = tentativeG;
              const f = tentativeG + h({gx:nx,gy:ny}, goal);
              fScore[nid] = f;
              open.push({ id: nid, f });
              inOpen[nid] = 1;
            }
          }
        }
        return null;
      }

      function simplifyPath(pathCells) {
        if (!pathCells || pathCells.length < 3) return pathCells || [];
        const out = [pathCells[0]];
        for (let i = 1; i < pathCells.length - 1; i++) {
          const a = out[out.length - 1];
          const b = pathCells[i];
          const c = pathCells[i+1];
          const abx = b.gx - a.gx, aby = b.gy - a.gy;
          const bcx = c.gx - b.gx, bcy = c.gy - b.gy;
          if (abx === bcx && aby === bcy) continue; // collinear
          out.push(b);
        }
        out.push(pathCells[pathCells.length - 1]);
        return out;
      }

      function getPathPercent(fromPercent, toPercent) {
        if (!state.ready) return null;

        let s = percentToGrid(fromPercent);
        let g = percentToGrid(toPercent);
        s = nearestRoadCell(s.gx, s.gy);
        g = nearestRoadCell(g.gx, g.gy);

        const cells = aStar(s, g);
        if (!cells) return null;

        const simp = simplifyPath(cells);

        // Convert to percent points
        return simp.map(c => gridToPercent(c.gx, c.gy));
      }

      // Tiny min-heap for A*
      class MinHeap {
        constructor() { this.a = []; }
        isEmpty() { return this.a.length === 0; }
        push(n) {
          this.a.push(n);
          this._up(this.a.length - 1);
        }
        pop() {
          const a = this.a;
          const top = a[0];
          const last = a.pop();
          if (a.length) { a[0] = last; this._down(0); }
          return top;
        }
        _up(i) {
          const a = this.a;
          while (i > 0) {
            const p = (i - 1) >> 1;
            if (a[p].f <= a[i].f) break;
            [a[p], a[i]] = [a[i], a[p]];
            i = p;
          }
        }
        _down(i) {
          const a = this.a;
          const n = a.length;
          while (true) {
            let l = i*2+1, r = l+1, s = i;
            if (l < n && a[l].f < a[s].f) s = l;
            if (r < n && a[r].f < a[s].f) s = r;
            if (s === i) break;
            [a[s], a[i]] = [a[i], a[s]];
            i = s;
          }
        }
      }

      return {
        buildFromImage,
        getPathPercent,
        get ready() { return state.ready; }
      };
    })();
