    // Purchase a property
    window.purchaseProperty = function(buildingId) {
      const building = GameState.propertyBuildings.find(b => b.id === buildingId);
      if (!building) return;
      
      if (GameState.player.cash < building.price) {
        alert('Not enough money!');
        return;
      }
      
      // Deduct money
      GameState.player.cash -= building.price;
      
      // Mark as owned
      building.owned = true;
      building.lastCollected = Date.now();
      
      // Save
      Storage.save();
      
      // Close modal and re-render
      closePropertyModal();
      renderPropertyBuildings();
      
      // Show notification
      TurfTab.showTemporaryNotification(`ðŸ¢ Purchased ${building.name}!`);
      
      // Update profile if visible
      ProfileTab.render();
    };

    // Collect income from property
    window.collectPropertyIncome = function(buildingId) {
      const building = GameState.propertyBuildings.find(b => b.id === buildingId);
      if (!building || !building.owned) return;
      
      const now = Date.now();
      const lastCollected = building.lastCollected || now;
      const daysSince = Math.floor((now - lastCollected) / (1000 * 60 * 60 * 24));
      
      if (daysSince < 1) {
        alert('Income already collected today. Come back tomorrow!');
        return;
      }
      
      const income = building.income * Math.min(daysSince, 7); // Max 7 days
      GameState.player.cash += income;
      building.lastCollected = now;
      
      Storage.save();
      
      closePropertyModal();
      
      TurfTab.showTemporaryNotification(`ðŸ’° Collected $${income.toLocaleString()}!`);
      ProfileTab.render();
    };

