        alert(`ðŸš¨ BUSTED! You've been arrested by patrol!\n\nðŸ’° Fine: $${fine.toLocaleString()}\nâ±ï¸ Jail Time: ${jailTime} seconds`);
        
        // Resume patrol after arrest
