    // ========================================
    // INMATE RECRUITMENT SYSTEM
    // ========================================
    
    const InmateSystem = {
      // Generate random inmate
      generateInmate() {
        const firstNames = ['Mike', 'Tony', 'Johnny', 'Vince', 'Frank', 'Rico', 'Carlos', 'Marcus', 'Andre', 'Luis'];
        const lastNames = ['Romano', 'DeVito', 'Russo', 'Martinez', 'Jackson', 'Lopez', 'Smith', 'Brown', 'Garcia', 'Davis'];
        
        const firstName = firstNames[Math.floor(Math.random() * firstNames.length)];
        const lastName = lastNames[Math.floor(Math.random() * lastNames.length)];
        
        // Generate random stats (10-50)
        const power = Math.floor(Math.random() * 40) + 10;
        const stealth = Math.floor(Math.random() * 40) + 10;
        const strength = Math.floor(Math.random() * 40) + 10;
        const intelligence = Math.floor(Math.random() * 40) + 10;
        
        const bailCost = Math.floor((power + stealth + strength + intelligence) * 100);
        
        return {
          id: 'inmate_' + Date.now() + '_' + Math.floor(Math.random() * 1000),
          name: `${firstName} "${firstName.substring(0, 3)}" ${lastName}`,
          power,
          stealth,
          strength,
          intelligence,
          bailCost,
          mode: 'laylow', // 'laylow' or 'working'
          recruitedAt: null,
          expiresAt: null,
          cashGenerated: 0
        };
      },
      
      // Refresh available inmates in jail
      refreshJailInmates() {
        console.log('Refreshing jail inmates...');
        
        // Generate 5 random inmates
        GameState.inmates.available = [];
        for (let i = 0; i < 5; i++) {
          GameState.inmates.available.push(this.generateInmate());
        }
        
        GameState.inmates.lastRefresh = Date.now();
        Storage.save();
        
        console.log('Generated 5 new inmates for recruitment');
      },
      
      // Recruit an inmate
      recruitInmate(inmateId) {
        const inmate = GameState.inmates.available.find(i => i.id === inmateId);
        if (!inmate) {
          console.error('Inmate not found');
          return false;
        }
        
        // Check if player has enough money
        if (GameState.player.cash < inmate.bailCost) {
          alert('Not enough money to bail out this inmate!');
          return false;
        }
        
        // Pay bail
        GameState.player.cash -= inmate.bailCost;
        
        // Set recruited timestamp and expiry (1 hour = 3600000ms)
        inmate.recruitedAt = Date.now();
        inmate.expiresAt = Date.now() + (60 * 60 * 1000); // 1 hour
        inmate.mode = 'laylow'; // Start in lay low mode
        inmate.cashGenerated = 0;
        
        // Move from available to recruited
        GameState.inmates.available = GameState.inmates.available.filter(i => i.id !== inmateId);
        GameState.inmates.recruited.push(inmate);
        
        Storage.save();
        
        console.log(`Recruited inmate: ${inmate.name}`);
        return true;
      },
      
      // Toggle inmate mode
      toggleInmateMode(inmateId) {
        const inmate = GameState.inmates.recruited.find(i => i.id === inmateId);
        if (!inmate) return;
        
        inmate.mode = inmate.mode === 'laylow' ? 'working' : 'laylow';
        Storage.save();
        
        console.log(`${inmate.name} is now ${inmate.mode}`);
      },
      
      // Update inmates (called periodically)
      updateInmates() {
        const now = Date.now();
        
        // Check for expired inmates
        GameState.inmates.recruited = GameState.inmates.recruited.filter(inmate => {
          if (now >= inmate.expiresAt) {
            console.log(`${inmate.name} has left (timer expired)`);
            return false;
          }
          
          // Generate cash for inmates in laylow mode (every update = ~$10)
          if (inmate.mode === 'laylow') {
            inmate.cashGenerated += 10;
          }
          
          return true;
        });
        
        Storage.save();
      },
      
      // Collect cash from laylow inmate
      collectInmateCash(inmateId) {
        const inmate = GameState.inmates.recruited.find(i => i.id === inmateId);
        if (!inmate || inmate.cashGenerated === 0) return 0;
        
        const cash = inmate.cashGenerated;
        GameState.player.cash += cash;
        inmate.cashGenerated = 0;
        
        Storage.save();
        return cash;
      },
      
      // Get total stats from working inmates
      getWorkingInmatesStats() {
        const stats = {
          power: 0,
          stealth: 0,
          strength: 0,
          intelligence: 0
        };
        
        GameState.inmates.recruited.forEach(inmate => {
          if (inmate.mode === 'working') {
            stats.power += inmate.power;
            stats.stealth += inmate.stealth;
            stats.strength += inmate.strength;
            stats.intelligence += inmate.intelligence;
          }
        });
        
        return stats;
      },
      
      // Get combined player stats (base + inmates)
      getCombinedStats() {
        const baseStats = GameState.player.stats;
        const inmateStats = this.getWorkingInmatesStats();
        
        return {
          power: baseStats.power + inmateStats.power,
          stealth: baseStats.stealth + inmateStats.stealth,
          strength: baseStats.strength + inmateStats.strength,
          intelligence: baseStats.intelligence + inmateStats.intelligence,
          charisma: baseStats.charisma // Charisma not affected by inmates
        };
      }
    };
    
