    // ========================================
    // CRIMES SYSTEM: Data Structure
    // ========================================
    // ========================================
    // XP AND LEVELING SYSTEM
    // ========================================
    const LevelingSystem = {
      // Calculate XP required for a given level (exponential scaling)
      // Level 1->2 = 125 XP, Level 2->3 = 200 XP, Level 3->4 = 325 XP, Level 4->5 = 500 XP
      getXPRequiredForLevel(level) {
        return Math.floor(100 + (level ** 2) * 25);
      },
      
      // Calculate XP reward with minor linear scaling (2% per level)
      // Level 1 = baseXP * 1.02, Level 2 = baseXP * 1.04, Level 10 = baseXP * 1.20
      scaleXPReward(baseXP) {
        return Math.floor(baseXP * (1 + GameState.player.level * 0.02));
      },
      
      // Calculate stat value for a given level (gradual scaling)
      // Level 1 = 5, Level 2 = 8, Level 3 = 10, Level 10 = 20, Level 20 = 35
      getStatForLevel(level) {
        return 5 + Math.floor(level * 1.5);
      },
      
      // Add XP and check for level up
      addXP(amount) {
        const scaledXP = this.scaleXPReward(amount);
        GameState.player.xp += scaledXP;
        
        // Check for level up (single level only per action)
        const xpNeeded = this.getXPRequiredForLevel(GameState.player.level);
        if (GameState.player.xp >= xpNeeded) {
          this.levelUp();
        }
        
        return scaledXP;
      },
      
      // Level up the player
      levelUp() {
        const xpNeeded = this.getXPRequiredForLevel(GameState.player.level);
        GameState.player.xp -= xpNeeded;
        GameState.player.level++;
        
        // Increase all stats based on new level
        const newStatValue = this.getStatForLevel(GameState.player.level);
        GameState.player.stats.strength = newStatValue;
        GameState.player.stats.intelligence = newStatValue;
        GameState.player.stats.charisma = newStatValue;
        
        // Update stealth based on level (5 stealth per level)
        GameState.player.stats.stealth = 5 * GameState.player.level;
        
        // Show level up notification
        this.showLevelUpNotification();
        
        console.log(`[LEVEL UP] Player reached level ${GameState.player.level}!`);
        console.log(`[LEVEL UP] Stats increased to ${newStatValue}`);
        console.log(`[LEVEL UP] Stealth increased to ${GameState.player.stats.stealth}`);
        console.log(`[LEVEL UP] Next level requires ${this.getXPRequiredForLevel(GameState.player.level)} XP`);
        
        Storage.save();
        
        // DO NOT check for multiple level-ups in single action
        // Player must perform multiple actions to gain multiple levels
      },
      
      showLevelUpNotification() {
        const notification = document.createElement('div');
        notification.className = 'level-up-notification';
        notification.innerHTML = `
          <div class="level-up-content">
            <div class="level-up-icon">â­</div>
            <div class="level-up-title">LEVEL UP!</div>
            <div class="level-up-level">Level ${GameState.player.level}</div>
            <div class="level-up-stats">All stats increased to ${this.getStatForLevel(GameState.player.level)}</div>
            <div class="level-up-stats">Stealth: ${GameState.player.stats.stealth} (Free Roam lasts longer!)</div>
          </div>
        `;
        
        document.getElementById('app').appendChild(notification);
        
        setTimeout(() => {
          notification.style.opacity = '0';
          setTimeout(() => notification.remove(), 500);
        }, 3000);
      },
      
      // Get progress toward next level
      getLevelProgress() {
        const xpNeeded = this.getXPRequiredForLevel(GameState.player.level);
        const progress = (GameState.player.xp / xpNeeded) * 100;
        return Math.min(100, progress);
      }
    };
    

    // ========================================
    // SECURE ECONOMY (Client + Server Reconciliation)
    // ========================================
    // Goal:
    // 1) Apply XP/Cash locally immediately (premium feel)
    // 2) Batch + send deltas to Cloud Function applyReward()
    // 3) Replace local truth with server truth when reply returns
    const SecureEconomy = (() => {
      const state = {
        pendingCash: 0,
        pendingBaseXp: 0,
        pendingReason: null,
        flushTimer: null,
        isFlushing: false,
        lastServerSync: 0,
      };

      function isReady() {
        return !!(window.firebaseReady && window.functions && window.auth && window.auth.currentUser && GameState && GameState.accountId);
      }

      function getCallable() {
        if (!window.functions) return null;
        try {
          return window.functions.httpsCallable('applyReward');
        } catch (e) {
          console.warn('[SecureEconomy] httpsCallable unavailable:', e);
          return null;
        }
      }

      function reconcileFromServer(serverPlayer) {
        if (!serverPlayer) return;
        // Keep username from local if server doesn't send it
        const keepUsername = GameState?.player?.username;
        GameState.player = GameState.player || {};

        // Replace authoritative fields
        if (typeof serverPlayer.cash === 'number') GameState.player.cash = serverPlayer.cash;
        if (typeof serverPlayer.level === 'number') GameState.player.level = serverPlayer.level;
        if (typeof serverPlayer.xp === 'number') GameState.player.xp = serverPlayer.xp;
        if (serverPlayer.stats) GameState.player.stats = serverPlayer.stats;
        if (keepUsername && !GameState.player.username) GameState.player.username = keepUsername;

        // Re-render UI safely
        try { ProfileTab.render(); } catch (_) {}
        try { TurfTab.updateHeatIndicator(); } catch (_) {}
        try { TurfTab.updateGlobalHeatDisplay(); } catch (_) {}
        try { if (GameState.gang) GangTab.render(); } catch (_) {}

        try { Storage.save(); } catch (_) {}
      }

      async function flush() {
        if (state.isFlushing) return;
        if (!isReady()) return;

        const applyReward = getCallable();
        if (!applyReward) return;

        // Nothing pending
        if (!state.pendingCash && !state.pendingBaseXp) return;

        state.isFlushing = true;
        const cashDelta = state.pendingCash;
        const xpDelta = state.pendingBaseXp;
        const reason = state.pendingReason || 'sync';

        // reset pending before awaiting (so new actions can queue)
        state.pendingCash = 0;
        state.pendingBaseXp = 0;
        state.pendingReason = null;
        state.flushTimer = null;

        try {
          const res = await applyReward({ cashDelta, xpDelta, reason });
          const data = res?.data || {};
          if (data.player) {
            state.lastServerSync = Date.now();
            reconcileFromServer(data.player);
          }
        } catch (e) {
          // If server call fails, we keep local changes (feels good) and will try again next award.
          console.warn('[SecureEconomy] Server reconcile failed:', e);
          // Re-queue the deltas so we don't lose them.
          state.pendingCash += cashDelta;
          state.pendingBaseXp += xpDelta;
          state.pendingReason = reason;
        } finally {
          state.isFlushing = false;
        }
      }

      function scheduleFlush() {
        if (state.flushTimer) return;
        // Small batch window cuts costs massively without affecting feel
        state.flushTimer = setTimeout(() => {
          flush();
        }, 750);
      }

      function award({ cashDelta = 0, baseXp = 0, reason = 'reward' } = {}) {
        // 1) Instant local apply
        if (cashDelta) {
          GameState.player.cash = Math.max(0, (GameState.player.cash || 0) + cashDelta);
        }

        let appliedXP = 0;
        if (baseXp) {
          // LevelingSystem handles scaling + (single) level-up logic locally
          appliedXP = LevelingSystem.addXP(baseXp);
        }

        // 2) Queue server reconcile
        if (cashDelta || baseXp) {
          state.pendingCash += cashDelta;
          state.pendingBaseXp += baseXp;
          state.pendingReason = reason;
          scheduleFlush();
        }

        return { appliedXP };
      }

      function adjustCash(delta, reason = 'cash') {
        return award({ cashDelta: delta, baseXp: 0, reason });
      }

      return {
        award,
        adjustCash,
        flush,
        reconcileFromServer,
        isReady,
      };
    })();

    // ========================================
    // ACTION-BASED HEAT SYSTEM
    // ========================================
    const ActionHeatSystem = {
      trackAction(crimeId, baseHeat) {
        const tracking = GameState.player.actionTracking;
        
        // Increment action counters
        tracking.totalActions++;
        tracking.actionsInCycle++;
        
        let heatToApply = 0;
        
        // Initial phase: Every 6 actions = 2% heat
        if (tracking.cyclePhase === 'initial') {
          if (tracking.actionsInCycle >= 6) {
            heatToApply = 2;
            tracking.actionsInCycle = 0; // Reset cycle
            tracking.cyclePhase = 'escalated'; // Move to escalated phase
            console.log('[HEAT] Initial phase complete: +2% heat after 6 actions');
          }
        }
        // Escalated phase: Every 4 actions = 4% heat
        else if (tracking.cyclePhase === 'escalated') {
          if (tracking.actionsInCycle >= 4) {
            heatToApply = 4;
            tracking.actionsInCycle = 0; // Reset cycle
            console.log('[HEAT] Escalated phase: +4% heat after 4 actions');
          }
        }
        
        // Add cooldown tracking for heat reduction
        const cooldownDuration = CrimesDatabase.crimes[crimeId]?.costs?.cooldown || 0;
        if (cooldownDuration > 0) {
          tracking.activeCooldowns.push({
            crimeId: crimeId,
            endTime: Date.now() + cooldownDuration,
            completed: false
          });
        }
        
        console.log(`[HEAT] Action tracked: ${tracking.actionsInCycle}/${tracking.cyclePhase === 'initial' ? 6 : 4} in ${tracking.cyclePhase} phase`);
        
        return heatToApply;
      },
      
      checkCooldownsForHeatReduction() {
        const tracking = GameState.player.actionTracking;
        const now = Date.now();
        let heatReduction = 0;
        
        // Check all active cooldowns
        if (!tracking.activeCooldowns || !Array.isArray(tracking.activeCooldowns)) {
          tracking.activeCooldowns = [];
        }
        tracking.activeCooldowns.forEach(cooldown => {
          if (!cooldown.completed && now >= cooldown.endTime) {
            // Cooldown completed - reduce heat by 2%
            heatReduction += 2;
            cooldown.completed = true;
            console.log(`[HEAT] Cooldown completed for ${cooldown.crimeId}: -2% heat`);
          }
        });
        
        // Clean up old completed cooldowns (keep last 10)
        tracking.activeCooldowns = tracking.activeCooldowns
          .filter(c => !c.completed || (now - c.endTime) < 60000)
          .slice(-10);
        
        if (heatReduction > 0) {
          GameState.player.heat = Math.max(0, GameState.player.heat - heatReduction);
          console.log(`[HEAT] Total heat reduction: -${heatReduction}%`);
          updateSirenByHeat(GameState.player.heat);
          Storage.save();
        }
      },
      
      resetPhase() {
        const tracking = GameState.player.actionTracking;
        tracking.cyclePhase = 'initial';
        tracking.actionsInCycle = 0;
        console.log('[HEAT] Phase reset to initial');
      }
    };
    
