      startFreeRoam() {
        // Track free roam start time for progressive heat
        if (!GameState.freeRoamStartTime) {
          GameState.freeRoamStartTime = Date.now();
          GameState.totalFreeRoamTime = 0; // Accumulated time in ms
        }

        // Move character every 2 seconds
        this.roamInterval = setInterval(() => {
          this.moveCharacter();
          this.maybeSpawnPickup();
        }, 2000);

        // Random events every 5-10 seconds
        this.scheduleNextEvent();

        // Start progressive heat gain
        this.startProgressiveHeatGain();

        this.ensureRoamSprite();
        if (this.roamSprite) this.roamSprite.start();
        console.log('Free roam started');
      },
      
      stopFreeRoam() {
        // Accumulate free roam time
        if (GameState.freeRoamStartTime) {
          const sessionTime = Date.now() - GameState.freeRoamStartTime;
          GameState.totalFreeRoamTime = (GameState.totalFreeRoamTime || 0) + sessionTime;
          GameState.freeRoamStartTime = null;
        }

        if (this.roamInterval) {
          clearInterval(this.roamInterval);
          this.roamInterval = null;
        }
        if (this.eventInterval) {
          clearTimeout(this.eventInterval);
          this.eventInterval = null;
        }
        if (this.progressiveHeatInterval) {
          clearInterval(this.progressiveHeatInterval);
          this.progressiveHeatInterval = null;
        }

        if (this.roamSprite) this.roamSprite.stop();
        console.log('Free roam stopped');
      },

      startProgressiveHeatGain() {
        // Progressive heat gain system based on total free roam time
        // Heat gain schedule:
        // 0-10 min: 0 â†’ 5 (gain 0.5 per minute = 0.0083 per second)
        // 10-20 min: 5 â†’ 10 (gain 0.5 per minute = 0.0083 per second)
        // 20-30 min: 10 â†’ 20 (gain 1.0 per minute = 0.0167 per second)
        // 30-40 min: 20 â†’ 35 (gain 1.5 per minute = 0.025 per second)
        // 40-50 min: 35 â†’ 50 (gain 1.5 per minute = 0.025 per second)
        // 50-60 min: 50 â†’ 70 (gain 2.0 per minute = 0.0333 per second)
        // 60+ min: 70 â†’ 95 (gain 2.5 per minute = 0.0417 per second)

        this.progressiveHeatInterval = setInterval(() => {
          if (!GameState.character.freeRoam || GameState.character.isDead) return;

          // Calculate total time in minutes
          const currentSessionTime = Date.now() - GameState.freeRoamStartTime;
          const totalTime = (GameState.totalFreeRoamTime || 0) + currentSessionTime;
          const totalMinutes = totalTime / (1000 * 60);

          // Determine heat gain rate based on time bracket
          let heatGainPerSecond = 0;

          if (totalMinutes < 10) {
            // 0-10 min: gain 5 heat total = 0.5 per minute
            heatGainPerSecond = 0.5 / 60;
          } else if (totalMinutes < 20) {
            // 10-20 min: gain 5 heat total = 0.5 per minute
            heatGainPerSecond = 0.5 / 60;
          } else if (totalMinutes < 30) {
            // 20-30 min: gain 10 heat total = 1.0 per minute
            heatGainPerSecond = 1.0 / 60;
          } else if (totalMinutes < 40) {
            // 30-40 min: gain 15 heat total = 1.5 per minute
            heatGainPerSecond = 1.5 / 60;
          } else if (totalMinutes < 50) {
            // 40-50 min: gain 15 heat total = 1.5 per minute
            heatGainPerSecond = 1.5 / 60;
          } else if (totalMinutes < 60) {
            // 50-60 min: gain 20 heat total = 2.0 per minute
            heatGainPerSecond = 2.0 / 60;
          } else {
            // 60+ min: gain 25 heat per 10 min = 2.5 per minute
            heatGainPerSecond = 2.5 / 60;
          }

          // Apply heat gain (check every 10 seconds, so multiply by 10)
          const heatGain = heatGainPerSecond * 10;

          if (heatGain > 0) {
            const oldHeat = GameState.player.globalHeat;
            GameState.player.globalHeat = Math.min(100, GameState.player.globalHeat + heatGain);

            // Log heat gain periodically (every minute)
            if (Math.floor(totalMinutes) !== Math.floor((totalMinutes - (10/60)))) {
              console.log(`Progressive heat gain: +${heatGain.toFixed(2)} (${totalMinutes.toFixed(1)} min free roam, heat: ${GameState.player.globalHeat.toFixed(1)})`);
            }

            this.updatePoliceActivity();
            this.updateGlobalHeatDisplay();
            ProfileTab.render();
            Storage.save();
          }
        }, 10000); // Check every 10 seconds
      },

      // === Free Roam Player Sprite (auto-roams between buildings) ===
