    async function init() {
      console.log('=== Crime RPG Initialization ===');
      console.log('ðŸš€ INIT FUNCTION STARTED');

      // Hide app until auth state is known (prevents UI bleed-through during sign-in/out)
      const appDivInit = document.getElementById('app');
      if (appDivInit) appDivInit.style.display = 'none';
      
      // Load Firebase first
      console.log('ðŸ”µ Attempting to load Firebase...');
      try {
        await loadFirebase();
        console.log('âœ… Firebase loaded successfully');
        
        // Initialize Google Auth Manager
        console.log('ðŸ” Initializing Google Auth Manager...');
        await GoogleAuthManager.init();
        console.log('âœ… Google Auth Manager initialized');
        
        // Wait for the first auth state callback (more reliable than a fixed timeout)
        await GoogleAuthManager.waitForFirstAuthState();
        
        // Check if user is signed in with Google
        if (GoogleAuthManager.isSignedIn()) {
          console.log('âœ… User signed in with Google:', GoogleAuthManager.getCurrentUser().email);

          // CRITICAL: Ensure app is visible when user is already signed in on page load
          const app = document.getElementById('app');
          if (app) {
            app.style.display = 'flex';
            console.log('[Init] âœ… App div displayed for already-signed-in user');
          }

          // CRITICAL: Remove any account overlay that might exist
          const overlay = document.getElementById('account-overlay');
          if (overlay) {
            overlay.remove();
            console.log('[Init] âœ… Removed account overlay for already-signed-in user');
          }

          // GoogleAuthManager.onUserSignedIn already handles game initialization
          return;
        } else {
          console.log('âŒ No Google user signed in - showing login screen');

          // CRITICAL FIX: Clear app DOM before showing login screen
          const app = document.getElementById('app');
          if (app) {
            console.log('[Init] Clearing app DOM before showing login screen');
            app.innerHTML = '';
            app.style.display = 'none';
          }

          // Wait a moment to ensure auth state is fully settled
          setTimeout(() => {
            if (!GoogleAuthManager.isSignedIn()) {
              console.log('[Init] Showing account creation prompt...');
              AccountUI.showAccountCreationPrompt(false);
            }
          }, 100);
          return;
        }
      } catch (error) {
        console.error('âŒ Failed to load Firebase:', error);
        console.log('âš ï¸ Falling back to local authentication...');
        
        // Fallback to old localStorage auth if Firebase fails
        const authState = AuthManager.getAuthState();
        
        if (!authState.isLoggedIn) {
          console.log('âŒ User not logged in - showing login screen');
          AuthManager.showLoginScreen();
          return;
        }
        
        console.log('âœ… User is logged in (local):', authState.activeUserId);
        
        // PHASE B: Execute boot flow
        console.log('ðŸ”„ Executing boot flow...');
        const canProceed = await BootFlow.executeBoot();
        
        if (!canProceed) {
          console.log('â¸ï¸ Waiting for account creation/sign-in...');
          return;
        }
        
        // User is authenticated, proceed with game initialization
        console.log('âœ… Boot flow complete - initializing game...');
        initializeGame();
      }
    }
    
